window.bookSummaryJSON = "<p>A mission gone wrong. Innocent lives have been lost. </p> <p>Escaping wrongful imprisonment wasn't something Connor had in mind, but being put into stasis aboard Earth's first interstellar colony ship was something he couldn't have prepared for. </p> <p>For 300,000 colonists, the new colony brings the promise of a fresh start...a second chance. Connor might be the wrong man for the colony, but he's the right man to see that it survives what's coming. </p> <p>A new world with new challenges, but the mission has changed. </p> <p>If you loved <i>Old Man's War</i> and <i>Ender's Game</i>, you'll love <i>Genesis</i> from First Colony, a new military science fiction series. </p>"; 
